import React, {Component} from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image';
import OverlayTrigger from 'react-bootstrap/OverlayTrigger';
import Tooltip from 'react-bootstrap/Tooltip';
import Collapse from 'react-bootstrap/Collapse';
import InputGroup from 'react-bootstrap/InputGroup';
import './styles/App.css';
import MyInput from "./MyInput";

class App extends Component {
    state = {
        open: false,
    };

    render() {
        const {open} = this.state;
        return (
            <Container>
                <Row className='justify-content-md-center'>
                        <Form>
                            <MyInput
                                controlId="formBasicEmail"
                                placeholder="Pick up:"
                            />
                            <MyInput
                                controlId="formBasicDestination"
                                placeholder="Destination:"
                            />
                            <MyInput
                                controlId="formBasicVoucher"
                                placeholder="Voucher code (optional):"
                                overlayTrigger={false}
                            />

                            <Row>
                                <Col md={5}><small>For 1-2 passengers with 1-2 bags</small></Col>
                                <Col md={{span: 3, offset: 3}} style={{ color: 'red'}}
                                     className='d-flex justify-content-end'>
                                    <div
                                        style={{cursor: 'pointer'}}
                                        onClick={() => this.setState({open: !open})}
                                        aria-controls="example-collapse"
                                        aria-expanded={open}
                                    >
                                        {!this.state.open?<small>more options</small>:<small>hide options</small>}
                                    </div>
                                </Col>
                            </Row>
                            <br/>

                            <Row>
                                <Col sm={8}>
                                    <Button variant="danger" size="lg" block>
                                        Start booking
                                    </Button>
                                </Col>
                            </Row>
                        </Form>

                </Row>
            </Container>
        );
    }
}

export default App;
